#define DFX ((int32_t)(1 << (31 - 2*LOG2_N)))


#if (FIXPT_SINCOS_INTRPL_POLY)
/* Polynomial interpolation version */
float f32sin(int32_t x)
{
	float y321;
	float y32;
	float y3;
	float x3;
	float qx2;
	float y21;
	float y2;
	float y1;
	float y;
	int32_t x2;
	int32_t x1;
	float qx1;
	float qx = (float)1.0 / DX;
	int32_t i;

	i = x >> (31 - LOG2_N);

	x1 = i << (31 - LOG2_N);
	y1 = qsintab[i++ & MASK_N] * ((x1 < 0) ? -1 : 1);

	x2 = x1 + DX;
	y2 = qsintab[i++ & MASK_N] * ((x2 < 0) ? -1 : 1);

	x3 = x2 + DX;
	y3 = qsintab[i & MASK_N] * ((x3 < 0) ? -1 : 1);

	y21 = (y2 - y1);
	y32 = (y3 - y2);
	y321 = (y32 - y21) / 2;

	qx1 = (x - x1) * qx;
	qx2 = (x - x2) * qx;

	y = y1 + y21 * qx1 + y321 * qx1 * qx2;

	return y;
}
#endif /* (FIXPT_SINCOS_INTRPL_POLY) */

#if (FIXPT_SINCOS_INTRPL_TRIG)
/* Circular interpolation version, using the trigonometric 
   identity: sin(a + b) = sin(a)*cos(b) + cos(a)*sin(b) 
*/
float f32sin(int32_t x)
{
	int32_t x0;
	int32_t x1;
	int32_t fx;
	float sin_x0;
	float cos_x0;
	float sin_fx;
	float cos_fx;
	float y;
	int32_t i;

	i = x >> (31 - LOG2_N);

	x0 = i << (31 - LOG2_N);
	sin_x0 = qsintab[i & MASK_N] * ((x0 < 0) ? -1 : 1);

	x1 = x0 + Q31(0.5);
	i = x1 >> (31 - LOG2_N);
	cos_x0 = qsintab[i & MASK_N] * ((x1 < 0) ? -1 : 1);

	fx = (x - x0);
	i = fx >> (31 - 2*LOG2_N);

	sin_fx = fsintab[i];

	cos_fx = fcostab[i];

	y = sin_x0 * cos_fx + cos_x0 * sin_fx;

	return y;
}
#endif /* (FIXPT_SINCOS_INTRPL_TRIG) */
